import React from 'react'

export default function Home() {
    return (
        <>
            <div className='container'>
                <section>
                    {/* below div represents left part of the form */}
                    <div className='left_data'> 
                       <h3>Sign Up</h3>
                    </div>
                    <div className='right_data'></div>
                </section>

            </div>
        </>
    )
}
